  - uid: 'excel!Excel.RemoveDuplicatesResult#uniqueRemaining:member'
    summary: |-
      <span data-ttu-id="01076-121">結果として生じた範囲に存在する残りの一意の行の数。</span><span class="sxs-lookup"><span data-stu-id="01076-121">Number of remaining unique rows present in the resulting range.</span></span>

      <span data-ttu-id="01076-122">\[[API セット: excelapi 1.9](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets)\]</span><span class="sxs-lookup"><span data-stu-id="01076-122">\[ [API set: ExcelApi 1.9](/office/dev/add-ins/reference/requirement-sets/excel-api-requirement-sets) \]</span></span>
    name: uniqueRemaining
    fullName: uniqueRemaining
    langs:
      - typeScript
    type: property
    syntax:
      content: 'readonly uniqueRemaining: number;'
      return:
        type:
          - number
        description: |-


          #### <a name="examples"></a><span data-ttu-id="01076-123">例</span><span class="sxs-lookup"><span data-stu-id="01076-123">Examples</span></span>

          ```typescript
          await Excel.run(async (context) => {
              const sheet = context.workbook.worksheets.getItem("Sample");
              const range = sheet.getRange("B2:D11");

              const deleteResult = range.removeDuplicates([0],true);    
              deleteResult.load();    
              await context.sync();

              console.log(deleteResult.removed + " entries with duplicate names removed.");
              console.log(deleteResult.uniqueRemaining + " entries with unique names remain in the range.");
          });
          ```
